import logo from "./logo.svg";
import "./App.css";
import Datas from "./data.json";
import Infos from "./example_data.json";

function App() {
  const info = Infos.map((Info) => (
    <ul key={Info.id}>
      <li>{Info.name}</li>
      <li>{Info.categories}</li>
      <li>
        <img src={Info.profile_image_url} alt={"logo"} width="250" />
      </li>
      <li>
        {Info.images.forEach((imginfo) => {
          <img src={imginfo} alt={"logo"} width="50" />;
        })}
      </li>
    </ul>
  ));
  const test = Datas.map((data) => (
    <ul key={data.id}>
      <li>{data.color}</li>
      <li>{data.value}</li>
      <br />
    </ul>
  ));

  console.log();
  return (
    <div className="App">
      <h1>APP</h1>
      {info}
    </div>
  );
}

export default App;
